import React from "react";
// Components
import "./News.css";
import image1 from '../../image/gift.png'
import {Card, CardImg, CardBody, CardTitle, CardText, Container, Row, Col} from 'reactstrap'




const News = () => (

    <div className="w-responsive text-center mx-auto p-3 mt-2">
        <Container>
            <Row>
                <Col xs="2"></Col>
                <col>
                    <img src={ image1 } />
                    <h1>Taking Your GDG Gift</h1>
                    <h3></h3>
                </col>
                <col><img src={ image1 } /></col>
            </Row>
        </Container>
    </div>
);

export default News;
